import{_ as a,c as o,o as s,ag as t}from"./chunks/framework.Ds6Eueu6.js";const h=JSON.parse('{"title":"DROP RESOURCE GROUP","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_RESOURCE_GROUP.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_RESOURCE_GROUP.md"}'),r={name:"docs/7x/ref_guide/sql_commands/DROP_RESOURCE_GROUP.md"};function n(i,e,p,l,c,d){return s(),o("div",null,e[0]||(e[0]=[t(`<h1 id="drop-resource-group" tabindex="-1">DROP RESOURCE GROUP <a class="header-anchor" href="#drop-resource-group" aria-label="Permalink to &quot;DROP RESOURCE GROUP&quot;">​</a></h1><p>Removes a resource group.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP RESOURCE GROUP &lt;group_name&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p>This command removes a resource group from WarehousePG. Only a superuser can drop a resource group. When you drop a resource group, the memory and CPU resources reserved by the group are returned to WarehousePG.</p><p>To drop a role resource group, the group cannot be assigned to any roles, nor can it have any statements pending or running in the group. If you drop a resource group that you created for an external component, the behavior is determined by the external component. For example, dropping a resource group that you assigned to a PL/Container runtime stops running containers in the group.</p><p>You cannot drop the pre-defined <code>admin_group</code> and <code>default_group</code> resource groups.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>group_name : The name of the resource group to remove.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>You cannot submit a <code>DROP RESOURCE GROUP</code> command in an explicit transaction or sub-transaction.</p><p>Use <a href="./ALTER_ROLE.html">ALTER ROLE</a> to remove a resource group assigned to a specific user/role.</p><p>Perform the following query to view all of the currently active queries for all resource groups:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT usename, query, waiting, pid,</span></span>
<span class="line"><span>    rsgid, rsgname, rsgqueueduration </span></span>
<span class="line"><span>  FROM pg_stat_activity;</span></span></code></pre></div><p>To view the resource group assignments, perform the following query on the <code>pg_roles</code> and <code>pg_resgroup</code> system catalog tables:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT rolname, rsgname </span></span>
<span class="line"><span>  FROM pg_roles, pg_resgroup</span></span>
<span class="line"><span>  WHERE pg_roles.rolresgroup=pg_resgroup.oid;</span></span></code></pre></div><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the resource group assigned to a role. This operation then assigns the default resource group <code>default_group</code> to the role:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER ROLE bob RESOURCE GROUP NONE;</span></span></code></pre></div><p>Remove the resource group named <code>adhoc</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP RESOURCE GROUP adhoc;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The <code>DROP RESOURCE GROUP</code> statement is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_RESOURCE_GROUP.html">ALTER RESOURCE GROUP</a>, <a href="./CREATE_RESOURCE_GROUP.html">CREATE RESOURCE GROUP</a>, <a href="./ALTER_ROLE.html">ALTER ROLE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,27)]))}const g=a(r,[["render",n]]);export{h as __pageData,g as default};
